window.bookSummaryJSON = "<p>From <i>New York Times</i> and <i>USA Today</i> bestselling author Laurelin Paige comes a story in her Slay series...</p> <p>Camilla Fasbender has a secret.</p> <p>Underneath her posh accent and designer clothes lies the evidence of her pain.</p> <p>Every heartbreak, every bad day, every setback has left a scar.</p> <p>From behind her camera, she shows the world what to see. And it isn't her.</p> <p>Until him.</p> <p>He sees right through her carefully constructed facade.</p> <p>And he's going to slash it all to pieces.</p> <p>**Every 1001 Dark Nights novella is a standalone story. For new listeners, it’s an introduction to an author’s world. And for fans, it’s a bonus book in the author’s series. We hope you'll enjoy each one as much as we do.**</p>"; 
